import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Link from '@material-ui/core/Link';
import CodeIcon from '@material-ui/icons/Code';
import CreateIcon from '@material-ui/icons/Create';
import Accordion from '@material-ui/core/Accordion';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import beer from './assets/beer.gif'
import './Tasks.css';

//Five levels - Sober,Buzzed,Tipsy,Drunk,Wasted

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

function Tasks() {
  const classes = useStyles();

  return (
    <header className="App-header">
        <br></br><br></br>     
  <div>
      <div class="neon">Reactjs </div>
      <div class="flux">Friends </div>
  </div>
  <div>A fun way to learn reactjs.</div>
    <img src={beer} alt="loading..." /> 
    <div className={classes.root}>
    <Accordion TransitionProps={{ unmountOnExit: true }}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography className={classes.heading}>Accordion 1</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse malesuada lacus ex,
            sit amet blandit leo lobortis eget.
          </Typography>
        </AccordionDetails>
      </Accordion>
      <Grid container spacing={10}>
        <Grid item xs={4}>
          <Paper className={classes.paper}>
              <h5>Task 1 </h5>
              <h3>Cheers React Friends</h3>
              <h6>Display Cheers React Friends on UI</h6>           
              <Link href="https://codesandbox.io/s/new" target="_blank" rel="noopener noreferrer" > <CreateIcon></CreateIcon></Link>&nbsp;
              <Link href="https://codesandbox.io/s/modest-pine-89j19?file=/src/App.js" target="_blank" rel="noopener noreferrer" ><CodeIcon></CodeIcon></Link>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>
              <h5>Task 2</h5>
              <h3>Birthday Picker</h3>
              <h6>Pop-up Calender and display selected date on UI</h6>
              <Link href="https://codesandbox.io/s/new" target="_blank" rel="noopener noreferrer" > <CreateIcon></CreateIcon></Link>&nbsp;
              <Link href="https://codesandbox.io/s/modest-pine-89j19?file=/src/App.js" target="_blank" rel="noopener noreferrer" ><CodeIcon></CodeIcon></Link>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>
              <h5>Task 3</h5>
              <h3>Cocktail Mocktail</h3>
              <h6>Display Cocktail menu in horizontal nav bar and Mocktail menu in vertical nac bar</h6>
              <Link href="https://codesandbox.io/s/new" target="_blank" rel="noopener noreferrer" > <CreateIcon></CreateIcon></Link>&nbsp;
              <Link href="https://codesandbox.io/s/modest-pine-89j19?file=/src/App.js" target="_blank" rel="noopener noreferrer" ><CodeIcon></CodeIcon></Link>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>
              <h5>Task 4</h5>
              <h3>Offer Drink</h3>
              <h6>Choose your favourite drink from menu and display that image on UI</h6>
              <Link href="https://codesandbox.io/s/new" target="_blank" rel="noopener noreferrer" > <CreateIcon></CreateIcon></Link>&nbsp;
              <Link href="https://codesandbox.io/s/modest-pine-89j19?file=/src/App.js" target="_blank" rel="noopener noreferrer" ><CodeIcon></CodeIcon></Link>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>
              <h5>Task 5</h5>
              <h3>Cheers React Friends</h3>
              <h6>Display Cheers React Friends on browser</h6>
              <Link href="https://codesandbox.io/s/new" target="_blank" rel="noopener noreferrer" > <CreateIcon></CreateIcon></Link>&nbsp;
              <Link href="https://codesandbox.io/s/modest-pine-89j19?file=/src/App.js" target="_blank" rel="noopener noreferrer" ><CodeIcon></CodeIcon></Link>
          </Paper>
        </Grid>
      </Grid>
    </div>
    </header>
  );
}

export default Tasks;
